    {id:1,title:'Producto 1'},
    {id:1,title:'Producto 1'},
    {id:1,title:'Producto 1'},
    {id:1,title:'Producto 1'},
  ]
  
    return (
    <>
      <h1>Componente ProductsPage</h1>
      <ul>
        <li><Link to='/products/1'>Producto 1</Link></li>
        <li>Producto 2</li>
        <li>Producto 3</li>
      </ul>
    </>
  );
}
